import React from "react";
import './header.css';
import logo from '../../assets/logo.png'

const Header = () => {
    return (
        <div className="ccs__header section__header section__padding" id="home">
        
            <div className="css__header-container">
                <h1 className="gradient__text"> Chewy's Chop Shop</h1>
            </div>
            <div ></div>
        </div>
    )
}
export default Header
